import React, { useRef, useState } from 'react';
import { Swiper, SwiperSlide } from 'swiper/react';

// Import Swiper styles
import 'swiper/css';
import 'swiper/css/navigation';

// import required modules
import { Autoplay, Navigation } from 'swiper/modules';

// image
import img5 from "../../assets/3d-cinema-theatre-room-with-seating-2.jpg"
import img2 from "../../assets/3d-rendering-cinema.jpg"
import img4 from "../../assets/retro-theatre-scene-celebrate-world-theatre-day.jpg"
import img6 from "../../assets/view-black-white-person-attending-theatre.jpg"
import img1 from "../../assets/view-3d-cinema-theatre-room-1.jpg"
import img3 from "../../assets/view-3d-cinema-theatre-room.jpg"

export default function App() {
  return (
    <>
      <Swiper
        spaceBetween={30}
        centeredSlides={true}
        autoplay={{
          delay: 3500,
          disableOnInteraction: false,
        }}
        navigation={false}
        modules={[Autoplay, Navigation]}
        className="mySwiper"
      >
        <SwiperSlide><img src={img1} alt='img1'/></SwiperSlide>
        <SwiperSlide><img src={img2} alt='img1'/></SwiperSlide>
        <SwiperSlide><img src={img3} alt='img1'/></SwiperSlide>
        <SwiperSlide><img src={img4} alt='img1'/></SwiperSlide>
        <SwiperSlide><img src={img5} alt='img1'/></SwiperSlide>
        <SwiperSlide><img src={img6} alt='img1'/></SwiperSlide>
      </Swiper>
    </>
  );
}
